Given a list of relationships, this method filters out all "duplicate" relationships connecting the same pair of
nodes.

For example, if the relationships are

[
  {
    "source": "node1",
    "target": "node2"
  },
  {
    "source": "node1",
    "target": "node2"
  },
  {
    "source": "node5",
    "target": "node6"
  },
]

then this method returns

[
  {
    "source": "node1",
    "target": "node2"
  },
  {
    "source": "node5",
    "target": "node6"
  },
]
